import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  constructor(){
    super();
    this.state={
      monsters:[
        {
          name: 'Yaksh'
         },
        {
          name:'Sanket'
         },
         {
          name:'Yashvi'
         },
         {
          name:'Namrata'
         }
      ]
    } 
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map((monster)=>{ return <h1>{monster.name}</h1>;}
          )
        }
      </div>
    );
  }

}

export default App;
